import React, { useEffect } from "react";
import { setSeasonCast } from "../../../slices/TvShowSlice";
import { useDispatch, useSelector } from "react-redux";
import { useParams } from "react-router-dom";
import { Link } from "react-router-dom";
import { fetchDetails } from "../../../utils/utils";

const SeasonCast = () => {
  const dispatch = useDispatch();
  const { id, season_number } = useParams();

  useEffect(() => {
    async function fetchDataFunction() {
      const result = await fetchDetails(
        `tv/${id}/season/${season_number}/aggregate_credits?language=en-US`
      );

      dispatch(setSeasonCast(result));
    }

    fetchDataFunction();
  }, [id, season_number]);

  const seasonPeople = useSelector((state) => state.series.seasonCast.data);
  console.log(seasonPeople);

  return <div></div>;
};

export default SeasonCast;
